Of the 102 nests monitored, only 80 completed their clutch, with the other 20 completely depredated, abandoned or destroyed by bad weather before clutch completion. Most completed clutches (69) contained a total of four eggs, ten clutches contained five eggs and one clutch contained three eggs. Clutch size is uncorrelated with treatment (
  z = -0.03; 
  P = 0.1990), laying date (
  z = -0.05; 
  P = 0.9780) or any environmental variables (P>0.8). The incubation period varies between nine and 13 days and is strongly influenced by clutch size, invertebrate availability, and total rainfall (Adj R
  2 = 0.34, 
  F
  6,70 = 7.46; 
  P<0.0001; 
  Table 3). Each additional egg in the clutch increases the incubation duration by 1.01 days (± 0.07; 
  F
  1,71 = 18.06; 
  P<0.0001). Increases in incubation duration are correlated with total rainfall (0.04 days ± 0.01; 
  F
  1,72 = 10.91; 
  P = 0.0015) and invertebrate availability (0.01 days ± 0.00; 
  F
  1,74 = 5.41; 
  P = 0.0229). There is a significant interaction between treatment and mean temperature, with increasing temperatures corresponding with shorter incubation durations in the treatment group (-0.17 days ± 0.07; 
  F
  1,70 = 6.47; 
  P = 0.0132). Of the 102 nests monitored across the three breeding seasons, 80 nests resulted in successful hatching of at least one egg. Of these successful nests, 14 contained unhatched eggs; overall 313 eggs hatched out of 329. Hatching success is uncorrelated with treatment (LRT = 0.07; 
  P = 0.7891), laying date (LRT = 1.03; 
  P = 0.3089) and any environmental variables (
  P> 0.4).
